"use strict";const TabControl=function(myTab,obj){if(obj!=undefined){console.log("Obj"+obj);if(obj.activeTabLinkClass!=undefined){this.activeTabLinkClass=obj.activeTabLinkClass}
if(obj.activeTabClass!=undefined){this.activeTabClass=obj.activeTabClass}
if(obj.activeTabBoxClass!=undefined){this.activeTabBoxClass=obj.activeTabBoxClass;console.log(obj.activeTabBoxClass)}}
if(document.querySelectorAll(myTab).length<1){return!1}
this.myTab=document.querySelectorAll(myTab)[0];for(let i=0;i<this.myTab.children.length;i++){if(this.myTab.children[i].nodeName=="UL"){let li=this.myTab.childNodes[i].nextElementSibling.children;for(let j=0;j<li.length;j++){let alink=li[j].children[0];alink.addEventListener("click",this.processTab.bind(this),!1)}}}
this.loadData=this.processTab.bind(this);window.addEventListener("hashchange",this.processTab.bind(this),!1);window.addEventListener("load",this.processTab.bind(this),!1)}
TabControl.prototype.activeTabLinkClass="active";TabControl.prototype.activeTabClass="activeLi";TabControl.prototype.activeTabBoxClass="activeTab";TabControl.prototype.mode="fade";TabControl.prototype.sendHashLink=function(hash){var allLinks=document.getElementsByTagName("a");for(let i=0;i<allLinks.length;i++){let myPage=allLinks[i].hash.split("#");if(myPage[1]==hash){return allLinks[i]}}}
TabControl.prototype.processTab=function(event){var eventhash="";try{if(event.type=="load"){eventhash=event.target.location.href;if(eventhash.search("#")==-1){return!1}
eventhash=eventhash.split("#")}else if(event.type=="hashchange"){if(event.newURL.search("#")==-1){return!1}
eventhash=event.newURL.split("#")}else if(event.type=="click"){eventhash=event.target.href;if(eventhash!=undefined){if(eventhash.search("#")==-1){return!1}else{event.preventDefault();document.location.href=event.target.href;eventhash=eventhash.split("#")}}}}catch(err){console.log(err)}
try{if(eventhash!=undefined){let hashElement=this.sendHashLink(eventhash[1]);let myTab=hashElement.parentNode.parentNode.parentNode}}catch(err){console.log(err)}
if(eventhash!=undefined){for(let i=0;i<myTab.children.length;i++){try{if(myTab.children[i].nodeName=="UL"){let li=myTab.childNodes[i].nextElementSibling.children;for(let j=0;j<li.length;j++){let alink=li[j].children[0];let aLinkHref=alink.href;let alinkHash=aLinkHref.split("#");try{if(alinkHash[1]==eventhash[1]){alink.className=this.activeTabLinkClass;alink.parentElement.className=this.activeTabClass}else{alink.className="";alink.parentElement.className=""}}catch(err){console.log(err)}}}}catch(err){console.log(err)}
try{if(myTab.children[i].nodeName=="DIV"&&myTab.children[i].className=="tabs"){let divTab=myTab.children[i];for(let i=0;i<divTab.children.length;i++){if(divTab.children[i].id==eventhash[1]){divTab.children[i].setAttribute("class","tab "+this.activeTabBoxClass)}else{divTab.children[i].setAttribute("class","tab")}}}}catch(err){console.log(err)}}}}